import React from "react";
import {
  IoMdAdd,
  IoMdDoneAll,
  IoMdEye,
} from "react-icons/io";
import { format } from "date-fns";
import { toast, ToastContainer } from "react-toastify";
import { MdDelete, MdEdit, MdShare } from "react-icons/md";
import Swal from "sweetalert2";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import SolvingTicket from "views/Modals/SolvingTicket";
import TransferingTicket from "views/Modals/TransferingTicket";
const PhoneTicketProcessing = () => {
    const [phoneticketData, setPhoneTicketData] = useState([]);
    const [selectedPhoneTicketIds, setselectedPhoneTicketIds] = useState([]);

    useEffect(() => {
      fetch("/api/ticket/phone")
        .then((response) => response.json())
        .then((data) => setPhoneTicketData(data))
        .catch((error) => console.error("Error fetching contrat data:", error));
    }, []);

    const handleCheckboxChange = (phoneticketId) => {
      setselectedPhoneTicketIds((prevSelectedIds) => {
        if (prevSelectedIds.includes(phoneticketId)) {
          return prevSelectedIds.filter((id) => id !== phoneticketId);
        } else {
          return [...prevSelectedIds, phoneticketId];
        }
      });
      console.log(phoneticketId);
    };

    const onDelete = async (phoneticketId) => {
      try {
        console.log("Deleting equipement with ID:", phoneticketId);
        const response = await fetch(`/api/phone/${phoneticketId}`, {
          method: "DELETE",
        });

        if (response.ok) {
          toast.success("La suppression a été effectuée avec succès.");
        } else {
          throw new Error("equipement deletion failed");
        }
      } catch (error) {
        console.error("Error:", error);
        toast.error("Une erreur est survenue lors de la suppression");
      }
    };
    const handleDeleteClick = () => {
      Swal.fire({
        icon: "warning",
        title: "Confirmation de suppression",
        text: "Êtes-vous sûr de vouloir supprimer ce client et ses contacts associés ?",
        showCancelButton: true,
        confirmButtonColor: "#d33",
        cancelButtonColor: "#3085d6",
        confirmButtonText: "Oui, supprimer",
        cancelButtonText: "Annuler",
      }).then((result) => {
        if (result.isConfirmed) {
          selectedPhoneTicketIds.forEach((phoneticketId) =>
            onDelete(phoneticketId)
          );
        } else if (result.dismiss === Swal.DismissReason.cancel) {
          console.log("Suppression annulée");
        }
      });
    };
    const handleSolved = () => {
      Swal.fire({
        icon: "success",
        title: "Confirmation de validation",
        text: "Voulez-vous marquer ce ticket comme résolu ?",
        showCancelButton: true,
        confirmButtonColor: "#d33",
        cancelButtonColor: "#3085d6",
        confirmButtonText: "Oui",
        cancelButtonText: "Annuler",
      }).then((result) => {
        if (result.isConfirmed) {
          selectedPhoneTicketIds.forEach((phoneticketId) =>
            onDelete(phoneticketId)
          );
        } else if (result.dismiss === Swal.DismissReason.cancel) {
          console.log("Termination annulée");
        }
      });
    };
    const handleTransfer  = () => {
      Swal.fire({
        icon: "success",
        title: "Confirmation de validation",
        text: "Voulez-vous marquer ce ticket comme résolu ?",
        showCancelButton: true,
        confirmButtonColor: "#d33",
        cancelButtonColor: "#3085d6",
        confirmButtonText: "Oui",
        cancelButtonText: "Annuler",
      }).then((result) => {
        if (result.isConfirmed) {
          selectedPhoneTicketIds.forEach((phoneticketId) =>
            onDelete(phoneticketId)
          );
        } else if (result.dismiss === Swal.DismissReason.cancel) {
          console.log("Termination annulée");
        }
      });
    };

    const [scnquery, setSCNQuery] = useState("");


    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isModalTicketOpen, setIsModalTicketOpen] = useState(false);
    const [selectedTicket, setSelectedTicket] = useState([]);

    const handleCloseModal = () => {
        setIsModalOpen(false);
    };
    const handleOpenModal = selectedTicket => {
        setSelectedTicket(selectedTicket);
        setIsModalOpen(true);
    }
    const handleCloseTransferModal = () => {
        setIsModalTicketOpen(false);
    };

    const handleOpenTransfeModal = (selectedTicket) => {
        setSelectedTicket(selectedTicket);
        setIsModalTicketOpen(true);
    }
    return (
        <div>
            <div class="mt-9 relative overflow-x-auto shadow-lg sm:rounded-lg">
                <div className=" mt-2 flex flex-column sm:flex-row flex-wrap space-y-4 sm:space-y-0 items-center justify-between pb-4 ml-2">

                    <div className="relative inline-block text-left">
                        <button
                            id="dropdownRadioButton"
                            type="button"
                            className="text-tunisys-100 inline-flex items-center bg-white border border-gray-300 focus:outline-none hover:bg-gray-100 focus:ring-4 focus:ring-gray-200 font-medium rounded-lg text-sm px-3 py-1.5 dark:bg-gray-800 dark:text-white dark:border-gray-600 dark:hover:bg-gray-700 dark:hover:border-gray-600 dark:focus:ring-gray-700"
                            onClick={toggleDropdown}
                        >
                            Phone Tickets                                <svg
                                className="w-2.5 h-2.5 ms-2.5"
                                aria-hidden="true"
                                xmlns="http://www.w3.org/2000/svg"
                                fill="none"
                                viewBox="0 0 10 6"
                            >
                                <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 1 4 4 4-4" />
                            </svg>
                        </button>

                        {isDropdownOpen && (
                            <div className="origin-top-right absolute right-0 mt-2 w-30 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5 divide-y divide-gray-100 dark:bg-gray-800 dark:border-gray-600 dark:divide-gray-700" role="menu" aria-orientation="vertical" aria-labelledby="options-menu">
                                <div className="py-1">
                                    <a href="../processing" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 hover:text-gray-900 dark:text-white dark:hover:bg-gray-700 dark:hover:text-red-500" role="menuitem"> Field Tickets</a>

                                </div>
                            </div>
                        )}
                    </div>

                    <div className="flex items-center flex-wrap space-x-5">

                        <label htmlFor="search" className="text-gray-500 dark:text-gray-400">
                            Equipement S/N :      </label>
                        <input
                            type="text"
                            id="search"
                            className="block p-2 text-sm text-gray-900 border border-gray-300 rounded-lg w-40 bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
                            placeholder="Search"
                        />




                        <button
                            type="button"
                            className="inline-flex ml-[-5px] items-center text-gray-500 bg-white border border-gray-300 focus:outline-none hover:bg-gray-100 focus:ring-4 focus:ring-gray-200 font-medium rounded-lg text-sm px-3 py-1.5 dark:bg-gray-800 dark:text-white dark:border-gray-600 dark:hover:bg-gray-700 dark:hover:border-gray-600 dark:focus:ring-gray-700"
                        >
                            <svg className="w-5 h-5 text-gray-500 dark:text-gray-400" aria-hidden="true" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" clip-rule="evenodd"></path></svg>

                            Search

                        </button>
                    </div>
                </div>

                <div className="border-b border-gray-900/10 pb-6"></div>
                <div className="overflow-x-auto">
                    <table className="min-w-full text-left text-sm text-gray-900 rtl:text-right dark:text-gray-900  sm:table lg:table">
                        <thead className="overflow-x-auto bg-gray-50 text-xs uppercase dark:bg-gray-900 ">
                            <tr className="">
                                <th scope="col" className="p-4">
                                    <div className="flex items-center">
                                        <input
                                            id="checkbox-all-search"
                                            type="checkbox"
                                            className="h-4 w-4 rounded border-gray-300 bg-gray-100 text-blue-600 focus:ring-2 focus:ring-blue-500 dark:border-gray-600 dark:bg-gray-700 dark:ring-offset-gray-800 dark:focus:ring-blue-600 dark:focus:ring-offset-gray-800"
                                        />
                                        <label htmlFor="checkbox-all-search" className="sr-only">
                                            checkbox
                                        </label>
                                    </div>
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900   dark:text-gray-300"
                                >
                                    Ticket No
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Status
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Equipement S/N
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Service Station
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Service type
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    TYPE
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Client
                                </th>

                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Call in Time
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Receiving Time
                                </th>

                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Technicien
                                </th>


                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Resolving time
                                </th>
                                <th
                                    scope="col"
                                    className="px-6 py-3 text-gray-900    dark:text-gray-300"
                                >
                                    Edit
                                </th>
                            </tr>
                        </thead>
                        <tbody>
                            {phoneticketData
                                .filter((phoneticket) =>
                                    Object.values(phoneticket)
                                        .filter((value) => typeof value === "string")
                                        .some((value) =>
                                            value.toLowerCase().includes(scnquery.toLowerCase())
                                        )
                                )
                                .map((phoneticket, index) => (
                                    <tr
                                        key={index}
                                        className="border-b bg-white hover:bg-gray-50 dark:border-gray-700 dark:bg-gray-800 dark:hover:bg-gray-600"
                                    >
                                        <td className="w-4 p-4">
                                            <div className="flex items-center">
                                                <input
                                                    id={`checkbox-table-search-${index}`}
                                                    type="checkbox"
                                                    className="h-4 w-4 rounded border-gray-300 bg-gray-100 text-blue-600 focus:ring-2 focus:ring-blue-500 dark:border-gray-600 dark:bg-gray-700 dark:ring-offset-gray-800 dark:focus:ring-blue-600 dark:focus:ring-offset-gray-800"
                                                    checked={selectedPhoneTicketIds.includes(
                                                        phoneticket._id
                                                    )}
                                                    onChange={() => handleCheckboxChange(phoneticket._id)}
                                                />
                                                <label
                                                    htmlFor={`checkbox-table-search-${index}`}
                                                    className="sr-only">
                                                    checkbox
                                                </label>
                                            </div>
                                        </td>
                                        <td
                                            scope="row"
                                            className="whitespace-nowrap px-6 py-4 font-medium text-gray-900 dark:text-white"
                                        >
                                            {phoneticket.reference || ''}
                                        </td>
                                        <td className="bg-tunisys-100 px-6 py-4 text-white">
                                            {phoneticket.status || ''}
                                        </td>
                                        <td className="px-6 py-4">{phoneticket.equipement?.equipement_sn || ''}</td>

                                        <td className="px-6 py-4">{phoneticket.service_station || ''}</td>
                                        <td className="px-6 py-4">{phoneticket.service_type || ''}</td>
                                        <td className="px-6 py-4">{phoneticket.type || ''}</td>

                                        <td className="px-6 py-4">{phoneticket.client ? (
                                            <>
                                                {phoneticket.client.client || ''}
                                            </>
                                        ) : (
                                            "N/A"
                                        )}</td>
                                        <td className="px-6 py-4"> {phoneticket.call_time ? format(new Date(phoneticket.call_time), 'yyyy/MM/dd ') : 'Not yet'}</td>
                                        <td className="px-6 py-4"> {phoneticket.receiving_time ? format(new Date(phoneticket.receiving_time), 'yyyy/MM/dd ') : 'Not yet'}</td>
                                        <td className="px-6 py-4">
                                            {phoneticket.technicien ? (
                                                <>
                                                    {phoneticket.technicien.firstname || ''} {phoneticket.technicien.lastname || ''}
                                                </>
                                            ) : (
                                                "N/A"
                                            )}
                                        </td>
                                        <td className="px-6 py-4">  {phoneticket.solving_time ? format(new Date(phoneticket.solving_time), 'yyyy/MM/dd ') : 'Not yet'}</td>
                                        <td className="px-6 py-4">
                                            <button
                                                scope="row"
                                                //onClick={() => handleOpenModal(equipement)}
                                                className=" whitespace-nowrap px-6   font-medium text-gray-900 dark:text-white"
                                            >
                                                <MdEdit className="h-6 w-6" />
                                            </button> </td>
                                    </tr>
                                ))}
                        </tbody>
                    </table>
                    {isModalOpen && <SolvingTicket handleClose={handleCloseModal} ticket={selectedTicket} />}
                    {isModalTicketOpen && <TransferingTicket handleClose={handleCloseTransferModal} ticket={selectedTicket} />}


                </div>
            </div>
            <nav className="flex items-center flex-column flex-wrap md:flex-row justify-between pt-4" aria-label="Table navigation">
                <span className="text-sm font-normal text-gray-500 dark:text-gray-400 mb-4 md:mb-0 block w-full md:inline md:w-auto">Showing <span class="font-semibold text-gray-900 dark:text-white">1-10</span> of <span class="font-semibold text-gray-900 dark:text-white">1000</span></span>
                <ul className="inline-flex -space-x-px rtl:space-x-reverse text-sm h-8">
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 ms-0 leading-tight text-gray-500 bg-white border border-gray-300 rounded-s-lg hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">Previous</a>
                    </li>
                    <li>
                        <a href="#" aria-current="page" className="flex items-center justify-center px-3 h-8 text-blue-600 border border-gray-300 bg-blue-50 hover:bg-blue-100 hover:text-blue-700 dark:border-gray-700 dark:bg-gray-700 dark:text-white">1</a>
                    </li>
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 leading-tight text-gray-500 bg-white border border-gray-300 hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">2</a>
                    </li>
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 leading-tight text-gray-500 bg-white border border-gray-300 hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">3</a>
                    </li>
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 leading-tight text-gray-500 bg-white border border-gray-300 hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">4</a>
                    </li>
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 leading-tight text-gray-500 bg-white border border-gray-300 hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">5</a>
                    </li>
                    <li>
                        <a href="#" className="flex items-center justify-center px-3 h-8 leading-tight text-gray-500 bg-white border border-gray-300 rounded-e-lg hover:bg-gray-100 hover:text-gray-700 dark:bg-gray-800 dark:border-gray-700 dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white">Next</a>
                    </li>
                </ul>
            </nav>
        </div>
    );
}

export default PhoneTicketProcessing;
